/* eslint-disable */
import "../App.css";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";

const selectCard = (name) => {
  console.log("Hello. " + name);
};

const Body = () => {
  return (
    <div class="card-deck">
      <div class="col d-flex justify-content-center">
        <div class="row">
          <div class="col-6">
            <div class="card" onClick={() => selectCard("cat")} click>
              <img
                class="card-img-top"
                src="https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/Cat03.jpg/1200px-Cat03.jpg"
                alt=""
              />
              <div class="card-body mx-auto">
                <h5 class="card-title">고양이</h5>
              </div>
              <a href="#" class="stretched-link"></a>
            </div>
          </div>

          <div class="col-6">
            <div class="card" onClick={() => selectCard("dog")}>
              <img
                src="https://cdn.crowdpic.net/detail-thumb/thumb_d_382A8A747FFDF073E20C13398D110DE7.jpg"
                alt=""
                class="card-img-top"
              />
              <div class="card-body mx-auto">
                <h5 class="card-title">강아지</h5>
              </div>
              <a href="#" class="stretched-link"></a>
            </div>
          </div>
        </div>
      </div>
      <br />
      <h1>동물 보호에 관심이 있으신가요?</h1>
    </div>
  );
};

export default Body;
